  \"2013-09-11T21:04:16.198951\",\n\t\"name\": \"point-shapefile-with-a-point-every-500-meters-along-the-cape-cod-national-seashore-resi-20-2004\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Continuous resistivity profiling (CRP)
  surveys were conducted at Cape Cod National Seashore in 2004 and 2006 in order to
  test hypotheses about groundwater flow under and into estuaries and the Atlantic
  Ocean. Coastal resource managers here and elsewhere are concerned about nutrients
  that are entering coastal waters via submarine groundwater discharge, which are
  contributing to eutrophication and harmful algal blooms. CRP is used to measure
  electrical resistivity of sediments, a property that is sensitive to differences
  in salinity of submarine ground water. The 2004 and 2006 surveys used floating resistivity
  streamers of 100 m and 50 m respectively. The depth penetration of the streamers
  is approximately 20% of the streamer length which translates to approximately 20-25
  m with the 100 m streamer and 12-14 m with the 50 m streamer. These data were processed
  using AGI's EarthImager 2D software.\",\n\t\"license_title\": null,\n\t\"extras\":
